getGeneralGallery();

var storageRef = firebase.storage().ref();

var imageSizeLimit = 3 * 1024 * 1024;

$('.general-gallery-form').on('submit', function(event){
	event.preventDefault();

	var files = document.getElementById('general-gallery-image-input').files;
	var fileLength = files.length

	if (fileLength <= 0) {
		showWarningMessage("Please select at least on image to upload", "Image upload");

	} else {
		$('.general-gallery-form button[type="submit"]').html("Uploading...").prepend(button_loader).prop('disabled', true);
		var downloadLinks = [];
		var counter = 0;

		for (file in files) {
			var imageRefName = "GMB_gallery_image_"+Date.now().toString().substr(0,9);
			var uploadTask = storageRef.child(imageRefName).put(files[file]);

			uploadTask.on('state_changed', function(snapshot){
			  var progress = (snapshot.bytesTransferred / snapshot.totalBytes) * 100;
			  console.log('Upload is ' + progress + '% done');
			  
			}, function(error) {
			  showErrorMessage("Check Your Internet Connection And Try Again.","Image upload");
			}, function() {
			   	uploadTask.snapshot.ref.getDownloadURL().then(function(downloadURL) {
			    	var data = {
			    		'galleryImage': downloadURL
			    	}

			    	$.post(CONSTANTS.UPLOAD_GALLERY_IMAGES_URL,data, function(response){
			    		console.log('response', response)
			    	})
				});
			});

			if (counter == (files.length -1)) {
				$('.general-gallery-form button[type="submit"]').html("Upload Images").prop('disabled', false);

				showSuccessMessage('Image uploaded successully', "Image upload");
				setTimeout(function() {
					window.location.reload();
				}, 7000);
			}

			counter ++;
		}
	}
})


