$('.general-gallery-image-input').on('change', function() {
	var files = document.getElementById('general-gallery-image-input').files;
	var fileLength = files.length

	if (fileLength > 0) {
		if (fileLength > 5) {
			showWarningMessage("You cannot upload more than 5 images at a time", "Image upload");
		}  else {
			if (fileLength == 1) {
				if (files[0].size > imageSizeLimit) {
					showWarningMessage("Image cannot be greater than 3MB", "Image upload")
				} else {
					$('.general-gallery-images-gallery-label').html(fileLength + " image selected");
				}
			} else {
				for (file in files) {
					if(files[file].size > imageSizeLimit){
						showWarningMessage("Image cannot be greater than 3MB", "Image upload")
					}
				} 
					
				$('.general-gallery-images-gallery-label').html(fileLength + " images selected");
			}
		}

	} 
});

