function deleteGeneralImage(itemObj) {
	var confirmDelete = confirm("Are you sure you want to delete this image?");
	if (confirmDelete) {

		var desertRef = storageRef.child(itemObj.gallery_image);
		desertRef.delete().then(function() {
			var data = {
				gallery_id: itemObj.gallery_id
			}

			$.post(CONSTANTS.DELETE_GENERAL_IMAGE_URL, data, function(response) {
				if (response.success) {
					showSuccessMessage(response.message, "Image upload");
					getGeneralGallery();
				} else {
					showSuccessMessage(response.message, "Image upload");
				}
			})
		}).catch(function(error) {
			console.log(error)
			showErrorMessage("Unable to delete image. Please check your internet connection", "Image upload")
		});
	}
}